#vhosts location
$vhostsDir = '/etc/apache2/sites-available';

#stack detail
$phpVersion = phpversion();
$apacheVersion = $_SERVER['SERVER_SOFTWARE'];
$mysqlVersion = mysql_get_client_info();

#ignored directory
$projectsListIgnore = array ('.','..');

#ignored vhosts
$vhostListIgnore = array( '000-default.conf', 'default-ssl.conf' );

#language
$langues = array(
