		'txtVhosts' => 'Your Virtual Hosts',
		'txtNoVhosts' => 'No Virtual Hosts yet.<br />To create a new one, create new file in /etc/apache2/sites-available'
	)
);

#images
$pngFolder = <<< EOFILE

EOFILE;

$pngFolderGo = <<< EOFILE

EOFILE;

$gifLogo = <<< EOFILE

EOFILE;

$pngPlugin = <<< EOFILE

EOFILE;

$pngWrench = <<< EOFILE

EOFILE;

$favicon = <<< EOFILE

EOFILE;


#phpinfo
if ( isset( $_GET['phpinfo'] ) ) {
	exit( phpinfo() );
}

#images
if (isset($_GET['img']))
{
    switch ($_GET['img'])
    {
        case 'pngFolder' :
        header("Content-type: image/png");
        echo base64_decode($pngFolder);
        exit();
        
        case 'pngFolderGo' :
        header("Content-type: image/png");
        echo base64_decode($pngFolderGo);
        exit();
        
        case 'gifLogo' :
        header("Content-type: image/gif");
        echo base64_decode($gifLogo);
        exit();
        
        case 'pngPlugin' :
        header("Content-type: image/png");
        echo base64_decode($pngPlugin);
        exit();
        
        case 'pngWrench' :
        header("Content-type: image/png");
        echo base64_decode($pngWrench);
        exit();
        
        case 'favicon' :
        header("Content-type: image/x-icon");
        echo base64_decode($favicon);
        exit();
    }
}

#php extension
$phpExtContents = null;
$loaded_extensions = get_loaded_extensions();
foreach ( $loaded_extensions as $extension ) {
	$phpExtContents .= "<li>${extension}</li>";
}

#projects content
$projectContents = null;
$handle = opendir( '.' );
while ( $file = readdir( $handle ) ) {
	if ( is_dir( $file ) && !in_array( $file, $projectsListIgnore ) ) {
		$projectContents .= '<li><a href="'.$file.'">'.$file.'</a></li>';
	}
}
closedir( $handle );
$projectContents = $projectContents ?: $langues[$langue]['txtNoProjet'];

#vhosts content
$vhostsContents = null;
if ( is_dir( $vhostsDir ) ) {
    $handle = opendir( $vhostsDir );
    while ( $file = readdir( $handle ) ) {
	    if ( is_file( $vhostsDir . DIRECTORY_SEPARATOR . $file ) && strstr( $file, '.conf' ) && !in_array( $file, $vhostListIgnore ) ) {
		    $vhostsContents .= '<li><a href="http://'.str_replace('.conf','',$file).'/">http://'.str_replace('.conf','',$file).'</a></li>';
	    }
    }
    closedir($handle);
}
$vhostsContents = $vhostsContents ?: $langues[$langue]['txtNoVhosts'];

